import * as React from 'react'

export default function PokemonDetails(props) {

  if (!props.selected) return "Loading..."

  return (
    <div>
      <h1>Selected Pokemon</h1>
      <div>
        <img src={props.selected.name} alt={props.selected.name} />
      </div>
      <div>
        {props.selected.image}
      </div >
      <div>
        {props.selected.weight}
      </div >
      <div>
        {props.selected.height}
      </div>
    </div>
  )
}
